import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';
import '../images/thecamp-logo.svg'
import './Body.css'

class Body extends React.Component {
    render() {
          return (
            <>
                <nav class="navbar bg-light">
                <div class="container-fluid">
                    <a class="navbar-brand" href="/">
                    <img src={require('../images/thecamp-logo.svg')} alt="thecamp-logo" width="250" height="80" class="d-inline-block align-text-top" />

                    {/* radio Component to make */}
                    <div class="btn-group btn-group-toggle" data-toggle="buttons">
                        <label class="btn btn-secondary active">
                            <input type="radio" name="options" id="option1" autocomplete="off" checked /> ESPACES
                        </label>
                        <label class="btn btn-secondary">
                            <input type="radio" name="options" id="option2" autocomplete="off" /> ECO-CONCEPTION
                        </label>
                    </div>

                    </a>
                </div>
                </nav>
            </>
          );
      }
}

export default Body;
